def run(value_list):
    """
    Calculates the average annual total assets for both fiscal years.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the average annual total assets.
    """
    total_assets_2019 = 0
    total_assets_2018 = 0

    for item in value_list:
        if item['header2'] == '2019':
            total_assets_2019 += item['number_value']
        elif item['header2'] == '2018':
            total_assets_2018 += item['number_value']

    average_assets = (total_assets_2019 + total_assets_2018) / 2

    if average_assets < 1000000:
        scale = 'thousand'
    elif average_assets < 100000000:
        scale = 'million'
    elif average_assets < 1000000000:
        scale = 'billion'
    else:
        scale = ''

    return (round(average_assets, 2), scale)

def run(value_list):
    """
    Calculates the percentage change of total assets from fiscal year 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the percentage change.
    """
    assets_2018 = 0
    for item in value_list:
        if item['header2'] == '2018':
            assets_2018 += item['number_value']

    assets_2019 = 0
    for item in value_list:
        if item['header2'] == '2019':
            assets_2019 += item['number_value']

    total_change = (assets_2019 - assets_2018) / assets_2018

    if abs(total_change) < 0.01:
        return (0.00, "")

    if total_change > 0:
        return (round(total_change * 100, 2), "%")
    else:
        return (round(total_change * 100, 2), "%")

