def run(value_list):
    """
    Calculates the average FY19 individual payout amount from the provided list.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the average payout amount and its scale.
    """
    payout_amounts = [item['number_value'] for item in value_list if item['header1'] == 'Individual Payout Amount ($)(4)']
    total_payout = sum(payout_amounts)
    num_payouts = len(payout_amounts)
    average_payout = total_payout / num_payouts

    if average_payout == 0:
        return (0.00, '')

    if average_payout < 1000000:
        return (round(average_payout, 2), 'thousand')
    elif average_payout < 100000000:
        return (round(average_payout / 100000, 2), 'million')
    elif average_payout < 1000000000:
        return (round(average_payout / 1000000, 2), 'billion')
    else:
        return (round(average_payout, 2), '')

