def run(value_list):
    """
    Calculates the percentage change in share of net earnings in other affiliates between 2018 and 2017.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    # Extract relevant data for 2018 and 2017
    try:
        year_2018_data = next((d for d in value_list if d['header1'] == '2018' and d['category'] == 'Share of net earnings in other affiliates'), None)
        year_2017_data = next((d for d in value_list if d['header1'] == '2017' and d['category'] == 'Share of net earnings in other affiliates'), None)

        if year_2018_data and year_2017_data:
            try:
                value_2018 = float(year_2018_data['number_value'])
                value_2017 = float(year_2017_data['number_value'])

                try:
                    percentage_change = ((value_2018 - value_2017) / value_2017) * 100
                    return (round(percentage_change, 2), 'percent')
                except ZeroDivisionError:
                    return (0.00, 'percent')
            except ValueError:
                return (0.00, 'percent')
        else:
            return (0.00, 'percent')
    except StopIteration:
        return (0.00, 'percent')

