def run(value_list):
    """
    Calculates the average Provision for (benefit from) income taxes for 2018 and 2019.

    Args:
        value_list: A list of dictionaries containing financial report data.

    Returns:
        A tuple (number, scale).
    """

    total_2018 = 0
    count_2018 = 0
    total_2019 = 0
    count_2019 = 0

    for item in value_list:
        if item['header3'] == '2018':
            total_2018 += item['number_value']
            count_2018 += 1
        elif item['header3'] == '2019':
            total_2019 += item['number_value']
            count_2019 += 1

    if count_2018 > 0 and count_2019 > 0:
        average = (total_2018 + total_2019) / (count_2018 + count_2019)
        return (round(average, 2), item['scale'])
    elif count_2018 > 0:
        return (round(total_2018 / count_2018, 2), item['scale'])
    elif count_2019 > 0:
        return (round(total_2019 / count_2019, 2), item['scale'])
    else:
        return (0.00, "")

