        between 2018 and 2019.
    """
    revenue_2018 = 0
    revenue_2019 = 0

    for item in value_list:
        if item['header1'] == '2018':
            if item['category'] == 'Total franchise revenues':
                revenue_2018 = item['number_value']
            elif item['category'] == 'Franchised restaurant sales':
