                revenue_2019 = item['number_value']
            elif item['category'] == 'Franchised restaurant sales':
                revenue_2019 = item['number_value']
            elif item['category'] == 'Franchise restaurant AUV':
                revenue_2019 = item['number_value']

    difference = abs(revenue_2019 - revenue_2018)

    if difference == 0:
        return (0.00, '')

    if difference < 1000000 and difference > 100000:
        scale = 'thousand'
    elif difference < 100000000 and difference > 1000000:
        scale = 'million'
    elif difference < 1000000000 and difference > 100000000:
        scale = 'billion'
    else:
