def run(value_list):
    """
    Calculates the difference between the total charges for fiscal year 2019 to 2018.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    total_2019 = 0
    total_2018 = 0

    for item in value_list:
        if item['header1'] == '2019' and item['category'] == 'Total':
            total_2019 = item['number_value']
        elif item['header1'] == '2018' and item['category'] == 'Total':
            total_2018 = item['number_value']

    difference = abs(total_2019 - total_2018)

    if difference == 0:
        return (0.00, "")

    if difference < 1000000:
        scale = "thousand"
    elif difference < 100000000:
        scale = "million"
    elif difference < 10000000000:
        scale = "billion"
    else:
        scale = ""

    return (round(difference, 2), scale)

