def run(value_list):
    """
    Calculates the average total fair value of long-lived assets held for sale for 2018 and 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the average total fair value.
    """
    long_lived_assets = []
    for item in value_list:
        if item['category'] == 'Long-lived assets held for sale':
            if 'June 30, 2019' in item['header*']:
                if 'number_value' in item and item['number_value'] is not None:
                    long_lived_assets.append(item['number_value'])
                elif 'Total Fair Value' in item['header*']:
                    if 'number_value' in item and item['number_value'] is not None:
                        long_lived_assets.append(item['number_value'])

    if not long_lived_assets:
        return (0.00, '')

    total_value = sum(long_lived_assets)
    average_value = total_value / len(long_lived_assets)

    if average_value == 0.00:
        return (0.00, '')

    if average_value < 1000000.00:
        scale = 'thousand'
    elif average_value < 1000000000.00:
        scale = 'million'
    elif average_value < 1000000000000.00:
        scale = 'billion'
    else:
        scale = ''

    return (round(average_value, 2), scale)

